import React from "react";
import "../styles/index.scss";

export const Navbar = () => {
  return (
    <nav className="">
      <div className="">
        <p className="">Natasha & Manuel</p>
        <div className="">
          <ul className="">
            <li className="">About</li>
            <li className="">Gallery</li>
            <li className="">Guestbook</li>
          </ul>
        </div>
        <div className="">
          <a href="/" className="">
            RSVP
          </a>
        </div>
      </div>
    </nav>
  );
};
